    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}


{#% block title %}Log in!{% endblock %}

{% block body %}
<form method=\"post\">
    {% if error %}
        <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
    {% endif %}

    {% if app.user %}
        <div class=\"mb-3\">
            You are logged in as {{ app.user.username }}, <a href=\"{{ path('app_logout') }}\">Logout</a>
        </div>
    {% endif %}

    <h1 class=\"h3 mb-3 font-weight-normal\">Connexion</h1>
    <label for=\"inputEmail\">Email</label>
    <input type=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control\" autocomplete=\"email\" required autofocus>
    <label for=\"inputPassword\">Password</label>
    <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" autocomplete=\"current-password\" required>

    <input type=\"hidden\" name=\"_csrf_token\"
           value=\"{{ csrf_token('authenticate') }}\"
    >

    {#
        Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
        See https://symfony.com/doc/current/security/remember_me.html

        <div class=\"checkbox mb-3\">
            <label>
                <input type=\"checkbox\" name=\"_remember_me\"> Remember me
            </label>
        </div>
    #}


{% block title %}Connexion{% endblock %}

{% block stylesheets %}
    <link rel=\"stylesheet\" href=\"./css/form.css\">
{% endblock %}

{% block body %}
<div class=\"formulaire\">

    <form method=\"post\">
        {% if error %}
            <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
        {% endif %}

        {% if app.user %}
            <div class=\"mb-3\">
                Vous êtes déjà connecté avec {{ app.user.username }}, <a href=\"{{ path('app_logout') }}\">deconnexion</a>
            </div>
        {% endif %}

        <h1>Connexion</h1>
        <div class=\"form-group\">
            <label for=\"inputEmail\">Email :</label>
            <input type=\"email\" value=\"{{ last_username }}\" placeholder=\"Email\" name=\"email\" 
            id=\"inputEmail\" class=\"form-control\" autocomplete=\"email\" required autofocus>
        </div>
        <div class=\"form-group\">
            <label for=\"inputPassword\">Mot de passe :</label>
            <input type=\"password\" name=\"password\" id=\"inputPassword\" placeholder=\"Mot de passe\"
            class=\"form-control\" autocomplete=\"current-password\" required>
        </div>
        

        <input type=\"hidden\" name=\"_csrf_token\"
            value=\"{{ csrf_token('authenticate') }}\"
        >

        {#
            Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
            See https://symfony.com/doc/current/security/remember_me.html

            <div class=\"checkbox mb-3\">
                <label>
                    <input type=\"checkbox\" name=\"_remember_me\"> Remember me
                </label>
            </div>
        #}
        <br>
        <button class=\"btn btn-lg btn-success\" type=\"submit\">Connexion</button>
    </form>
</div>


{% endblock %}
", "security/login.html.twig", "C:\\Users\\Fg\\passageAGue\\templates\\security\\login.html.twig");
